import { useEffect } from 'react';
import './App.css';

function App() {

  useEffect(() => {
    // fetch returns a promise
    fetch('https://dummyjson.com/todos/user/5')
      .then((res) => console.log('res', res))
  }, [])

  return (
    <section>
      <header>
        <h1>Todos</h1>
      </header>
    </section>
  );
}

export default App;
